\c zin
drop table if exists streams;
drop table if exists disposition;
drop table if exists format;
drop table if exists tags;
drop table if exists mp3s;
create table if not exists streams ("index" integer,"codec_name" varchar(3),"codec_long_name" varchar(24),"codec_type" varchar(5),"codec_time_base" varchar(7),"codec_tag_string" varchar(12),"codec_tag" varchar(6),"sample_fmt" varchar(4),"sample_rate" integer,"channels" integer,"channel_layout" varchar(6),"bits_per_sample" integer,"r_frame_rate" varchar(3),"avg_frame_rate" varchar(3),"time_base" varchar(10),"start_pts" integer,"start_time" integer,"duration_ts" varchar(11),"duration" double precision,"bit_rate" integer,"filepath" varchar(113));
create table if not exists format ("filename" varchar(113),"nb_streams" integer,"nb_programs" integer,"format_name" varchar(3),"format_long_name" varchar(28),"start_time" integer,"duration" double precision,"size" integer,"bit_rate" integer,"probe_score" integer,"filepath" varchar(113));
create table if not exists disposition ("default" integer,"dub" integer,"original" integer,"comment" integer,"lyrics" integer,"karaoke" integer,"forced" integer,"hearing_impaired" integer,"visual_impaired" integer,"clean_effects" integer,"attached_pic" integer,"timed_thumbnails" integer,"filepath" varchar(113));
create table if not exists tags ("album" varchar(14),"composer" varchar(13),"genre" varchar(29),"title" varchar(62),"artist" varchar(68),"disc" varchar(3),"track" varchar(5),"date" integer,"filepath" varchar(113));
create table if not exists mp3s ("filepath" varchar(113));


